import React from "react";

export default function Footer() {
    return (
        <div className="footer container-fluid">
            <h4>TỔNG CÔNG TY ZERO NINE</h4>
            <h4>Tổng đài CHKH: 0917686101</h4>
            <p>Copyright © 2015 - 2022 Phongtro123.com</p>
            <p>Email: cskh.phongtro123@gmail.com</p>
            <p>
                Địa chỉ: LE-4.07, Toà nhà Lexington Residence, Số 67 Mai Chí Thọ, Phường
                An Phú, Quận 2, Tp. Hồ Chí Minh
            </p>
            <p>
                Giấy phép đăng ký kinh doanh số 0313588502 do Sở kế hoạch và Đầu tư
                thành phố Hồ Chí Minh cấp ngày 14 tháng 04 năm 2022.
            </p>
        </div>
    );
}
